import React from "react";
//import Pion from './Pions';
import './style.css';

const Case = () => {

    const Pion = () => {
        return (
            <div className="pion" style={{ backgroundColor: 'black' }}></div>
        )
    }

    const changeColor = () => {
        changeColor = false;
        if (changeColor) {
            <div className="pion" style={{ backgroundColor: 'white' }}></div>
        } else {
            <div className="pion" style={{ backgroundColor: 'black' }}></div>
        }
    }

    return (
        <button className="rondCases" onClick={changeColor}>
            <Pion />
            <Pion />
            <Pion />
            <Pion />
            <Pion />
        </button>
    )
}

export default Case;
